import React from 'react';

const Sidebar = () => {
    return ( 
        
            <ul className="nav flex-column">
                <li className="nav-item">
                    <a className="nav-link" href="!#">Crear Usuarios</a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="!#">Actividades</a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="!#">Peticiones</a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="!#" tabindex="-1" aria-disabled="true">Administrar Usuarios</a>
                </li>
            </ul>
      


     );
}
 
export default Sidebar;
